(1, 7, 'Redcliffe Labs', 'Glucose Fasting (BSF)', '2024-04-17', 'LABORATORY REPORT\r\nRedcliffe Labs\r\nPatient Name : MR JERRY BARA\r\nDOB/Age/Gender : 33 Y/Male\r\nSample Collected : Apr 17, 2024, 11:17 AM\r\nPatient ID / UHID : 7967940/OF7967940\r\nReport Date : Apr 17, 2024, 02:53 PM\r\nReferred By : Self\r\nBarcode No : ZC405120\r\nSample Type : FLUORIDE F\r\nReport Status : Final Report\r\nNABL ACCREDITED LABS\r\nNABL MIELIT-0040S\r\nTest Description Value(s) Unit(s) Reference Range\r\nGlucose Fasting (BSF)\r\nGlucose Fasting\r\nHexokinase 77 mg/dL 70 - 100\r\nInterpretation:\r\nStatus Fasting plasma glucose in mg/dL\r\nNormal <100\r\nImpaired fasting glucose 100 - 125\r\nDiabetes >=126\r\nReference : American Diabetes Association\r\nComment:\r\nBlood glucose determinations in commonly used as an aid in the diagnosis and treatment of diabetes. Elevated glucose levels (hyperglycemia)\r\nmay also occur with pancreatic neoplasm, hyperthyroidism, and adrenal cortical hyper function as well as other disorders. Decreased glucose\r\nlevels (hypoglycemia) may result from excessive insulin therapy insulinoma, or various liver diseases.\r\nNote\r\n1. The diagnosis of Diabetes requires a fasting plasma glucose of > or = 126 mg/dL or a random / 2 hour plasma glucose value of > or = 200\r\nmg/dL with symptoms of diabetes mellitus.\r\n2. Very high glucose levels (>450 mg/dL in adults) may result in Diabetic Ketoacidosis.\r\n*** End Of Report ***\r\nPallavi\r\nDr. Pallavi Rath\r\nMBBS, MD (Pathology)\r\nConsultant Pathologist\r\nBooking Centre : Shradha Pathology, Flat 7 Sant Mauli Kripa Apt Prabhat Nagar Lane 1 Pimple Gurav Pune, Maharastra - 411061\r\nProcessing Lab :- Redcliffe Lifetech Pvt. Ltd., First Floor, B Wing, Aswani Chambers, S.No. 199+204+205 206/1, 209/1,\r\n928-809-6609\r\nwww.redcliffelabs.com\r\nAll Lab results are subject to clinical interpretation by qualified medical professional and this report is rot subject to use for any medico-legal purpose.\r\nPage 1 of 1', 'backend/uploads/reports/rpt_698da6415fd815.54705480.jpg', 'Mr. Jerry Bara\'s lab report indicates a Fasting Glucose result of 77 mg/dL. This value falls within the normal reference range of 70-100 mg/dL, suggesting healthy blood sugar levels. Based on this test, there are no concerns regarding diabetes.', '          mg/dL    - mg/dL     ,               ', 'normal', '2026-02-12 10:06:57'),
(3, 13, '', 'Handwritten Medical Note / Prescription', NULL, 'Paracetamol - 20mg\r\nSynex - 100 mg\r\n(slight fever)\r\n(headache)\r\nsymptom', 'backend/uploads/reports/rpt_698e3bca389b08.25018613.jpg', 'The image is a handwritten note, not a laboratory report. it lists medications (Paracetamol and Synex) along with symptoms of a slight fever and headache. Please consult a doctor for a proper diagnosis and treatment plan.', '     ,            (  )             ', 'normal', '2026-02-12 20:44:58'),
